import './NotPlayable.css'
import PropTypes from 'prop-types'
import React, { useEffect, useState } from 'react';

const NotPlayable = ({ card , mat}) => {
    const [isOpen, setIsOpen] = useState(false)

    useEffect(() => {
        if(card <= mat[0]) {
            setIsOpen(false)
        } else {
            setIsOpen(true)
        }
    }, [card, mat])


    return (
        <div className="not_playable">
            {isOpen ? (
                <p></p> 
            ) : (
                <p></p> 
            )}
        </div>
    )
}

NotPlayable.propTypes = {
    card: PropTypes.oneOfType([
        PropTypes.number,
        PropTypes.oneOf([' '])
    ]).isRequired,
    mat: PropTypes.array
};

export default NotPlayable;
